    await $('//*[@text="Trash Can"]').click();

    // assertions
    const trashCanItem = await $('//*[@resource-id="com.socialnmobile.dictapps.notepad.color.note:id/title"]'); 

    await expect(trashCanItem).toHaveText(note);
  });
});

